import axios from "axios";

const BASE_URL = "https://covid19.mathdro.id/api";

export const fetchData = async () => {
  try {
    const response = await axios.get(BASE_URL);

    return response;
  } catch (error) {
    console.log("j.error = ", error);
  }
};
